import React, {Component} from 'react';
import './candidates.js';

class Candidates extends Component{
    constructor() {
        super();
        this.state = {
            candidates: []
        }
    }

    componentDidMount() {
        fetch('/voting-app/candidates')
            .then(res => res.json())
            .then(candidates => this.setState({candidates}));
    }

    render(){
        return (
            <div>
              <h2>Candidates</h2>
            </div>
        );
    }
}

export default Candidates;
